#include <bits/stdc++.h>
using namespace std;
class Solution
{
public:
    int activitySelection(vector<int> s, vector<int> e, int n)
    {
        vector<pair<int, int>> v;
        for (int i = 0; i < n; i++)
            v.push_back({e[i], s[i]});

        sort(v.begin(), v.end());
        v.push_back({-1, -1});
        int ans = 0, i = 0;
        while (i < n - 1)
        {
            if (v[i].first < v[i + 1].second)
            {
                cout << v[i].second << " " << v[i + 1].first << endl;
                ans += 1;
            }
            i++;
        }
        return ans;
    }
};
